import React, { useState } from "react";

function Panier() {
    return (

        <div className="border-dashed border-2 border-sky-500">
            <div>
                <div>Ma commande</div>
                <ul>
                    <li></li>
                </ul>
            </div>
            <div>
                <NavItem name="ACCUEIL" link="/expositions" />
                <NavItem name="EXPOSITIONS" link="/expositions" />
            </div>

        </div>

    )
}

export default Panier;
